import React, { Component } from "react";
import { MyContext } from "../context";
import { ProductCard, MainWrapp, RowContainer } from "../styledComponents/StyledComps";

export default class IndividualProduct extends Component {
  showSettings(event) {
    event.preventDefault();
  }
  render() {
    return (
      <MyContext.Consumer>
        {context => (
          <MainWrapp>
					<RowContainer>


					</RowContainer>
            <ProductCard></ProductCard>
						<div></div>
          </MainWrapp>
        )}
      </MyContext.Consumer>
    );
  }
}
